// src/Component/Card.js
import React from 'react';
import './Card.css';

const Card=( { username, userPost, likes, disLikes } ) => {
    return (
        <div className='card'>
            <h3>{username}</h3>
            <p>{userPost}</p>
            <div className='reactions'>
                <span>Likes: {likes}</span>
                <span>Dislikes: {disLikes}</span>
            </div>
        </div>
    );
};

export default Card;
